import matrixgifgrande from '../imgs/matrix_gif_g.gif';

export default class Header extends React.Component{
    render(){
        return(
            <div className="w3-container HeaderDiv">
                <div><img src={matrixgifgrande} alt="image"></img></div>
            </div>
        );
    }
}
